<?php

namespace App\Models;

use Illuminate\Database\Eloquent\Factories\HasFactory;
use Illuminate\Database\Eloquent\Model;

class Car extends Model
{
    use HasFactory;
    protected $fillable = [
        'code_car',
        'brand', 
        'model', 
        'year',
        'traction',
        'engineType',
        'kind',
        'color',
        'plate',
        'image',
        'status'
    ];

    public function getImageAttribute($value)
    {
        if($value){
            return $value;
        } else {
            return '';
        }
    }
}
